import { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import "./UserPage.css";
import { useUser } from './src/';
const RegisterUserPage = () => {
  
  const [firtsNameRegis, setFirtsNameRegis] = useState("");
  const [lastNameRegis, setLastNameRegis] = useState("");
  const [mailRegis, setMailRegis] = useState("");
  const [passwordRegis, setPasswordRegis] = useState("");
  const [confirmPasswordRegis, setConfirmPasswordRegis] = useState("");

  const [emailLoguin, setEmailLogin] = useState("");
  const [passwordLoguin, setPasswordLogin] = useState("");

  const navigate = useNavigate();

  const userRegister = async () => {
    if (
      firtsNameRegis === "" ||
      lastNameRegis === "" ||
      mailRegis === "" ||
      passwordRegis === "" ||
      confirmPasswordRegis === ""
    ) {
      alert("Por favor completar el formulario");
      return;
    }

    if (passwordRegis !== confirmPasswordRegis) {
      alert("Las contraseñas deben coincidir");
      return;
    }

    try {
      let objUser = {
        firstName: firtsNameRegis,
        lastName: lastNameRegis,
        email: mailRegis,
        password: passwordRegis,
      };
      let responseUser = await axios.post(
        "http://localhost:8110/api/movie/register",
        objUser
      );
      if (responseUser.status !== 200) {
        alert("Hubo un error al registrar el usuario");
        return;
      }
      alert("El registro fue exitoso");
      setFirtsNameRegis("");
      setLastNameRegis("");
      setMailRegis("");
      setPasswordRegis("");
      setConfirmPasswordRegis("");
    } catch (e) {
      console.log(e);
    }
  };

  const userLogin = async () => {
    if (emailLoguin === "" || passwordLoguin === "") {
      alert("Completar el formulario");
      return;
    }

    let objLogin = {
      email: emailLoguin,
      password: passwordLoguin,
    };

    let resultLogin = await axios.post(
      "http://localhost:8110/api/movie/login",
      objLogin
    );

    if (resultLogin.data === false) {
      alert("Mail o contraseña son incorrectos");
      return;
    }
    navigate("/movies");
  };

  const handleSubmit = (e) => {
    e.preventDefault();
  };

  return (
    <div>
      <div className="title">
        <h1>Welcome to Movie Crew</h1>
      </div>
      <div className="container">
        <div className="register">
          <h3>Register</h3>
          <form onSubmit={handleSubmit}>
            <label>First Name: </label>
            <br />
            <input
              type="text"
              value={firtsNameRegis}
              onChange={(e) => setFirtsNameRegis(e.target.value)}
            />
            <br />
            <label>Last Name: </label>
            <br />
            <input
              type="text"
              value={lastNameRegis}
              onChange={(e) => setLastNameRegis(e.target.value)}
            />
            <br />
            <label>Email: </label>
            <br />
            <input
              type="text"
              value={mailRegis}
              onChange={(e) => setMailRegis(e.target.value)}
            />
            <br />
            <label>Password: </label>
            <br />
            <input
              type="password"
              value={passwordRegis}
              onChange={(e) => setPasswordRegis(e.target.value)}
            />
            <br />
            <label>Confirm Password: </label>
            <br />
            <input
              type="password"
              value={confirmPasswordRegis}
              onChange={(e) => setConfirmPasswordRegis(e.target.value)}
            />
            <br />
            <br />
            <button onClick={userRegister}>Register</button>
          </form>
        </div>
        <div className="login">
          <h3>Login</h3>
          <form onSubmit={handleSubmit}>
            <label>Email: </label>
            <br />
            <input
              type="text"
              value={emailLoguin}
              onChange={(e) => setEmailLogin(e.target.value)}
            />
            <br />
            <label>Password: </label>
            <br />
            <input
              type="password"
              value={passwordLoguin}
              onChange={(e) => setPasswordLogin(e.target.value)}
            />
            <br />
            <br />
            <button onClick={userLogin}>Login</button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default RegisterUserPage;
